        const listItems = lista.map(function(element, index) {
            return (
            <div>
                <div> List project</div>
                <br/>
                <div className='doc'>
                    <lu> Name user: 
                    <div style={{ color: 'red' }}>{element.user}</div>
                    </lu>
                    <br/>
